contract ONE is ERC20, Ownable {
    using SafeMath for uint256;

    uint256 public constant MAX_FEE = 10;

    IRouter public router;
    address public pair;
    
    bool private swapping;

    uint256 public maxBuyTransactionAmount =  5000000  * (10**18);
    uint256 public maxSellTransactionAmount = 1000000 * (10**18);

    uint256 public swapTokensAtAmount = 100000000 * (10**18);
    
    // fees
    uint256 public BuyFee = 8;
    uint256 public SellFee = 8;
    uint256 public TransferFee = 2;
    uint256 public totalBuyFees = BuyFee;
    uint256 public totalSellFees = SellFee;
    uint256 public totalTransferFees = TransferFee;

    uint256 public totalFeesCollected;

    address public immutable USDT = address(0x55d398326f99059fF775485246999027B3197955); // USDT

    address public MarketingWallet =  0x977fa7611AAC600f3dAB784e2F07c909730c6E70;
    address public TransferFeeWallet = 0xb90282a32B7196Ec83323304dfcfE93B9d1Ec2Ad;

    // exlcude from fees and max transaction amount
    mapping (address => bool) private _isExcludedFromFees;

    // blacklist wallet addresses
    mapping(address => bool) public _isBlacklisted;

    // store addresses that a automatic market maker pairs. Any transfer *to* these addresses
    // could be subject to a maximum transfer amount
    mapping (address => bool) public automatedMarketMakerPairs;

    event ExcludeFromFees(address indexed account, bool isExcluded);
    event ExcludeMultipleAccountsFromFees(address[] accounts, bool isExcluded);

    event BlacklistAddressUpdated(address account, bool isBlacklisted);

    event MarketingWalletUpdated(address oldWallet, address newWallet);
    event TransferFeeWalletUpdated(address oldWallet, address newWallet);

    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);

    event MaxBuyTransactionAmountUpdated(uint256  newValue, uint256  oldValue);
    event MaxSellTransactionAmountUpdated(uint256  newValue, uint256  oldValue);

    event SwapTokensAtAmountUpdated(uint256  newValue, uint256  oldValue);

    event UpdateBuyFees(
        uint256 _BuyFee
    );

    event UpdateSellFees(
        uint256 _SellFee
    );

    event UpdateTransferFees(
        uint256 _TransferFee
    );

    constructor() ERC20("ONE", "ONE", 18) {

        router = IRouter(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        
        pair = IFactory(router.factory()).createPair(address(this), router.WETH());

        _setAutomatedMarketMakerPair(pair, true);

        // exclude from paying fees or having max transaction amount
        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);
        excludeFromFees(0xB7b52Eb105475615dd790b09AA60846caF72144e, true);
        excludeFromFees(MarketingWallet, true);
        excludeFromFees(TransferFeeWallet, true);
    
        _mint(0xB7b52Eb105475615dd790b09AA60846caF72144e, 8000000000 * (10**18));
    }

    receive() external payable {

    }
    
    // @dev Owner functions start -------------------------------------
    
    function updateSwapTokensAtAmount(uint256 newAmount) external onlyOwner{
        emit SwapTokensAtAmountUpdated(swapTokensAtAmount ,newAmount);
        swapTokensAtAmount = newAmount * 10**18;
    }

    function updateMaxBuyTransactionAmount(uint256 newAmount) external onlyOwner {
        emit MaxBuyTransactionAmountUpdated(maxBuyTransactionAmount ,newAmount);
        maxBuyTransactionAmount = newAmount * 10**18;
    }

    function updateMaxSellTransactionAmount(uint256 newAmount) external onlyOwner {
       emit MaxSellTransactionAmountUpdated(maxSellTransactionAmount ,newAmount);
        maxSellTransactionAmount = newAmount * 10**18;
    }

    function mint(address _to, uint256 _tokenAmount) public onlyOwner {
        _mint(_to, _tokenAmount * (10**18));
    }

    function setBlacklistAddress(address account, bool value) external onlyOwner {
        _isBlacklisted[account] = value;
        emit BlacklistAddressUpdated(account, value);
    }

    function setMarketingWallet(address payable _newWallet) external onlyOwner {
        emit MarketingWalletUpdated(MarketingWallet, _newWallet);
        MarketingWallet = _newWallet;
        
         _isExcludedFromFees[_newWallet] = true;
        emit ExcludeFromFees(_newWallet, true);
    }

    function setTransferFeeWallet(address payable _newWallet) external onlyOwner {
       emit TransferFeeWalletUpdated(TransferFeeWallet, _newWallet);
        TransferFeeWallet = _newWallet;

         _isExcludedFromFees[_newWallet] = true;
        emit ExcludeFromFees(_newWallet, true);
    }

    function setBuyFee(uint256 _BuyFee) external onlyOwner{
        require(_BuyFee <= MAX_FEE, "Max Buy fee was 10");

        BuyFee = _BuyFee;

        totalBuyFees = BuyFee;
        emit UpdateBuyFees(_BuyFee);

    }

    function setSellFee(uint256 _SellFee) external onlyOwner{
        require(_SellFee <= MAX_FEE, "Max Sell fee was 10");

        SellFee = _SellFee;

        totalSellFees = SellFee;
        emit UpdateSellFees(_SellFee);

    }

    function setTransferFee(uint256 _TransferFee) external onlyOwner{
        require(_TransferFee <= MAX_FEE, "Max Transfer fee was 10");

        TransferFee = _TransferFee;

        totalTransferFees = TransferFee;
        emit UpdateTransferFees(_TransferFee);

    }

    // excludes wallets from max txn and fees.
    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    // allows multiple exclusions at once
    function excludeMultipleAccountsFromFees(address[] calldata accounts, bool excluded) external onlyOwner {
        for(uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }

        emit ExcludeMultipleAccountsFromFees(accounts, excluded);
    }
    
    // allow adding additional AMM pairs to the list
    function setAutomatedMarketMakerPair(address newpair, bool value) external onlyOwner {
        _setAutomatedMarketMakerPair(newpair, value);
    }
    
    function isExcludedFromFees(address account) public view returns(bool) {
        return _isExcludedFromFees[account];
    }

    // @dev Token functions
    function _setAutomatedMarketMakerPair(address _pair, bool value) private {
        require(automatedMarketMakerPairs[_pair] != value, "Automated market maker pair is already set to that value");
        automatedMarketMakerPairs[_pair] = value;

        emit SetAutomatedMarketMakerPair(pair, value);
    }

   function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(!_isBlacklisted[from] && !_isBlacklisted[to], "Blacklisted address");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        } else if (
            !swapping && !_isExcludedFromFees[from] && !_isExcludedFromFees[to]
        ) {
            bool isSelling = automatedMarketMakerPairs[to];
            bool isBuying = automatedMarketMakerPairs[from];

            if (
                isSelling && // sells only by detecting transfer to automated market maker pair
                from != address(router) //router -> pair is removing liquidity which shouldn't have max
            ) {
                
                require(amount <= maxSellTransactionAmount, "maximum sell amount reached.");

                uint256 fees = amount * totalSellFees / 100;
                amount = amount.sub(fees);
                totalFeesCollected += fees;
                super._transfer(from, address(this), fees);

            }

            else if (
                isBuying &&
                to != address(router)
            ) {
                require(amount <= maxBuyTransactionAmount, "maximum buy amount reached.");
                
                uint256 fees = amount * totalBuyFees / 100;
                amount = amount.sub(fees);
                totalFeesCollected += fees;
                super._transfer(from, address(this), fees);
               
            }else{

                uint256 fees = amount * totalTransferFees / 100;
                amount = amount.sub(fees);
                totalFeesCollected += fees;
                super._transfer(from, TransferFeeWallet, fees);

            }

            uint256 contractTokenBalance = balanceOf(address(this));

            bool canSwap = contractTokenBalance >= swapTokensAtAmount;
            
            if (canSwap && !automatedMarketMakerPairs[from]) {
                swapping = true;

                swapTokensForMarketingUSDT(balanceOf(address(this)));

                swapping = false;
            }
            
            
        }

        super._transfer(from, to, amount);

        
    }

    function swapTokensForMarketingUSDT(uint256 tokenAmount) private {

        address[] memory path = new address[](3);
        path[0] = address(this);
        path[1] = router.WETH();
        path[2] = USDT;

        _approve(address(this), address(router), tokenAmount);

        // make the swap
        router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            MarketingWallet,
            block.timestamp
        );
    }


